                                    </div>

                                </div>

                            </div>

                            {/* Button Container */}
                            <div className="mbp-button-container">

                                {/* Play Button */}
                                <Link
                                    className="mbp-button mbp-play-button"
                                    to="/section-one-quiz"
                                    onClick={() => { selectedInteraction.complete = true }}
                                >
                                    Play
                                </Link>

                                {/* Not Now Button */}
                                <button className="mbp-button mbp-cancel-button">
                                    Not Now
                                </button>

                            </div>

                            {/* Character Container */}
