                    //         >
                    //             <h3>{ selectedInteraction.description }</h3>
                    //         </Link>
                    //     </div>
                    // </InfoWindow>
                ) ||
                selectedInteraction === Interaction.locations.Quiz[1] && (
                    <div className="map-button-popup">

                        {/* Container */}
